    false,nt"url": null,nt"notes": "This report summarizes available information
    relevant to refuge water resources, provides an assessment of refuge water resource
    needs and issues of concern, and makes recommendations regarding potential actions
    to address priority water resource threats and needs. Major topics addressed in
    the report include the natural setting of the refuge (topography, climate, geology,
    soils, hydrology), impacts of development and climate change, significant water
    resources and associated infrastructure within the refuge, past and current water
    monitoring activities on and near the refuge, water quality information, and state
    water use regulatory framework. Information was compiled from publicly available
    reports, databases, and geospatial datasets from federal, state, and local agencies;
    published research reports; websites maintained by government agencies, academic
    institutions, and non-governmental organizations; and from files and Geographical
    Information Systems (GIS) data layers maintained by the refuge.",nt"license_title":
